from itertools import permutations
from collections import Counter

class SubstrFinder(object):
    # Sliding window method: from ChatGPT with my modification
    def find_substring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        if not s or not words:
            return []

        word_len = len(words[0])
        word_total = len(words)
        word_counter = Counter(words)
        results = []
        
        substr_len = word_len * word_total

        # We loop to word_len to ensure we consider all possible starting points
        for i in range(word_len):
            left = i
            right = i
            curr_counter = Counter()

            while left + substr_len <= len(s):
                w = s[right:right+word_len]
                curr_counter[w] += 1
                right += word_len
                # If the count of the current word in curr_counter 
                # exceeds its count in the original word list, 
                # then we need to adjust our window.
                while curr_counter[w] > word_counter[w]:
                    curr_counter[s[left:left+word_len]] -= 1
                    left += word_len

                if right - left == substr_len:
                    results.append(left)
        return results
    
